import React from 'react';
import './UserTable.css';

const UserTable = ({ data=[] }) => {



    
const sampleUser = [
    {
      id: "678dcfacb91e637d2ce2f4ab",
      name: "test",
      email: "test@gmail.com",
      department: "legal",
      orgId: 1,
      secret: "ituJDEoIPGKh",
      status: "active",
    },
    {
      id: "678dcfacb91e637d2ce2f4ac",
      name: "example",
      email: "example@gmail.com",
      department: "marketing",
      orgId: 2,
      // secret: "xyz123secret",
      status: "inactive",
    },
    // Add more users as needed
  ];
  
    data=sampleUser;
    console.log(data);

  return (
    <div className="table-card">
      <h3 className="table-title">Detailed Table</h3>
      <table className="styled-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Status</th>
            <th>Name</th>
            <th>Email</th>
            <th>Department</th>
            <th>Organization ID</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              <td>{item.id}</td>
              <td>{item.status}</td>
              <td>{item.name}</td>
              <td>{item.email}</td>
              <td>{item.department}</td>
              <td>{item.orgId}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default UserTable;
